// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
// pragma experimental ABIEncoderV2;
// struct:  max 12 element
// uint8:   max-value: 255
// uint16:  max-value: 65,535 (65535)
// uint32:  max-value: 4,294,967,295 (4294967295)
// uint64:  max-value: 18,446,744,073,709,551,615 (18446744073709551615)
// uint128: max-value: 340,282,366,920,938,463,463,374,607,431,768,211,455 (340282366920938463463374607431768211455)
// uint256: max-value: 115792089237316195423570985008687907853269984665640564039457584007913129639935
// từ solidity ^0.8.0 cộng trừ tràn số sẽ bị revert nên không cần dùng SafeMath
// khi convert uint-bé sang uint-lớn thì ok, uint-lớn sang uint-bé nếu value lớn hơn max-value nó chỉ lấy hiệu số sau khi trừ đi max-value
// liên quan đến ERC20 thì nên dùng uint256 vì có thể một số token có decimals hoặc totalSupply lớn
//----------
// các biến đầu vào và đầu ra không nên sử dụng tiền tố _, đầu ra 1 biến thì k cần tạo tên biến, >= 2 biến thì nên tạo tên biến
    // tạo tên biến không tốn thêm dung lượng
// các mảng tham số đầu vào và đầu ra sử dụng "memory" chứ không sử dụng "calldata" vì có giới hạn dung lượng
// connex v1: đầu vào không hỗ trợ Tuple và Tuple[], đầu ra không hỗ trợ Tuple và Tuple[], call trực tiếp từ biến public thì hỗ trợ Tuple
// connex v2: đầu vào không hỗ trợ Tuple và Tuple[] -> đã báo cáo với vechain
// đầu vào cần hỗ trợ connex v1,v2, đầu ra có thể không cần hỗ trợ v1 nếu call thông qua server
// VeChain hỗ trợ clauses nên không cần dùng Tuple cho đầu vào, một clauses bị reverted thì cả giao dịch đó bị reverted
// address(0) không thể là contract nên làm địa chỉ Payment cho native token được

/*
import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/access/Ownable.sol"; // @ [import: Context]
import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/security/Pausable.sol"; // @ [import: Context]
    // Pausable.sol: nếu sử dụng thì cần gọi _pause() và _unpause()
import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/security/ReentrancyGuard.sol"; // @
    // ReentrancyGuard.sol: sử dụng khi gọi đến contract không phải do mình triển khai, multiple clauses vẫn hỗ trợ
import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/utils/structs/EnumerableSet.sol"; // @
*/

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

// openzeppelin-contracts/v4.3.2
interface IERC20_1 {
    // event Transfer(address indexed from, address indexed to, uint256 value);
    // event Approval(address indexed owner, address indexed spender, uint256 value);
    // function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    // function allowance(address owner, address spender) external view returns (uint256);
    // function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    // function permit(address owner, address spender, uint256 value, uint256 deadline, uint8 v, bytes32 r, bytes32 s) external; VPU
}

// ERC20StakingV1: xác định chỉ có Owner được tạo pool
contract ERC20StakingV1 is Ownable, Pausable, ReentrancyGuard {
    using EnumerableSet for EnumerableSet.UintSet;

    struct StakingPool {
        address erc20; // erc20 token address for staking
        uint256 startedAt; // (seconds)
        uint128 commitReward; // (wei) total commitment reward
        uint128 minAmount; // (wei) phải > 0
        uint128 maxAmount; // (wei) mặc dù một người vẫn stake được nhiều lần nhưng cũng gây hạn chế thao tác
        uint32 minDuration; // (hours) phải >= 1
        uint32 maxDuration; // (hours)
        uint32 minAPY; // APY cho minDuration: 1000 <=> 1%
        uint32 maxAPY; // APY cho maxDuration: 1000 <=> 1%
    }

    struct StakingPoolDeep {
        uint128 totalStaking; // (wei) tổng số token các user đã staking trên pool này, chỉ cộng dồn
        uint128 totalReward; // (wei) tổng số phần thưởng phải trả, chỉ trừ đi khi adminUnstake vì lúc này user không được nhận reward
        uint128 remainingStaking; // (wei) tổng số token các user đang còn staking trên pool này, trừ đi mỗi khi user rút hoặc adminUnstake
        uint32 remainingStakeId; // tổng số stakeId còn lại trên pool này chưa rút tiền, trừ đi mỗi khi user rút hoặc adminUnstake
        bool isPaused; // cho phép create hay update
    }


    struct StakingDetails {
        address account;
        uint256 startedAt; // (seconds)
        uint128 stakeAmount; // (wei)
        uint128 rewardAmount; // (wei) số phần thưởng người dùng nhận được
        uint32 duration; // (hours)
        uint32 poolId;
    }

    /* ========== STATE VARIABLES ========== */
// StakingPool ------------------------------
    mapping (uint32 => StakingPool) public stakingPools; // poolId -> StakingPool
    mapping (uint32 => StakingPoolDeep) public stakingPoolDeeps; // poolId -> StakingPoolDeep
    // EnumerableSet.UintSet private _stakingPoolIds; // poolId List, sử dụng uint32[] bên dưới
    uint32[] public stakingPoolIds; // poolId List
// end: StakingPool ------------------------------

// Staking ------------------------------
    uint256 public stakeIdCounter; // sử dụng làm stakeId, cộng dồn mỗi lần thêm 1 stake
    uint256 public totalStakeId; // tổng số stakeId còn lại trên tất cả các pool, trừ đi mỗi khi user rút hoặc adminUnstake
    mapping (uint256 => StakingDetails) public stakeIdToDetails; // stakeId -> StakingDetails
// end: Staking ------------------------------

// ERC20 ------------------------------
    struct Erc20Info {
        uint256 remainingStaking; // tổng số token user còn đang staking trên tất cả các pool, trừ đi mỗi khi user rút hoặc adminUnstake
        uint256 remainingReward; // tổng số tiền cam kết trả thưởng trên tất cả các pool, trừ phần thưởng user đã rút hoặc adminUnstake
                            // mục đích để biết cần gửi thêm bao nhiêu token đến hợp đồng
    }
    mapping(address => Erc20Info) public erc20InfoMap; // erc20 address => Erc20Info
// end: ERC20 ------------------------------

// User ------------------------------
    mapping (address => EnumerableSet.UintSet) private _userStakeIds; // user address => stakeId List
// end: User ------------------------------

    /* ========== CONSTRUCTOR ========== */
    /* constructor() {
    } */

    // ================================================================================
    /* ========== Write Contract ========== */
    // ================================================================================
    // @
    function stake(uint32 poolId, uint128 amount, uint32 duration) external whenNotPaused nonReentrant {
        require(_checkPoolIsActive(poolId), "E1"); // E1 = Staking pool not ready
        // -----
        StakingPool memory sPool = stakingPools[poolId];
        require(amount >= sPool.minAmount && amount <= sPool.maxAmount, "E2"); // E2 = Invalid amount
        require(duration >= sPool.minDuration && duration <= sPool.maxDuration, "E3"); // E3 = Invalid duration
        // -----
        address sender = _msgSender();
        (uint128 rewardCal, ) = rewardCalculation(poolId, amount, duration); // reward nhận được
        StakingPoolDeep storage spDeep = stakingPoolDeeps[poolId];
        require(spDeep.totalReward + rewardCal <= sPool.commitReward, "E4"); // E4 = Exceed pool commit reward
        IERC20_1(sPool.erc20).transferFrom(sender, address(this), amount); // không cần kiểm tra require vì nếu không đủ điều kiện sẽ bị revert

        // update stakingPoolDeeps -----
        spDeep.totalStaking += amount;
        spDeep.totalReward += rewardCal;
        spDeep.remainingStaking += amount;
        spDeep.remainingStakeId += 1;

        // update Staking -----
        stakeIdCounter += 1; // start from 1, stakeId bắt đầu từ 1
        totalStakeId += 1;

        // add StakingDetails
        stakeIdToDetails[stakeIdCounter] = StakingDetails({
            account: sender,
            startedAt: block.timestamp,
            stakeAmount: amount,
            rewardAmount: rewardCal,
            duration: duration,
            poolId: poolId
        });

        // update User -----
        _userStakeIds[sender].add(stakeIdCounter);

        // update Erc20Info -----
        erc20InfoMap[sPool.erc20].remainingStaking += amount;
        erc20InfoMap[sPool.erc20].remainingReward += rewardCal;

        // Event -----
        emit Staked(sender, stakeIdCounter, amount, duration, poolId);
    }

    // @
    function withdrawStake(uint128 stakeId) external whenNotPaused nonReentrant {
        address sender = _msgSender();
        StakingDetails memory sd = stakeIdToDetails[stakeId];
        require(sender == sd.account, "E5"); // E5 = Invalid account
        uint256 endTime = sd.startedAt + (sd.duration * 1 hours);
        require(block.timestamp >= endTime, "E6"); // E6 = the deadline has not expired

        // update stakingPoolDeeps -----
        StakingPoolDeep storage spDeep = stakingPoolDeeps[sd.poolId];
        spDeep.remainingStaking -= sd.stakeAmount;
        spDeep.remainingStakeId -= 1;

        // update User -----
        _userStakeIds[sender].remove(stakeId);

        // update Erc20Info -----
        address erc20 = stakingPools[sd.poolId].erc20;
        erc20InfoMap[erc20].remainingStaking -= sd.stakeAmount;
        erc20InfoMap[erc20].remainingReward -= sd.rewardAmount;

        // transfer -----
        uint128 totalAmount = sd.stakeAmount + sd.rewardAmount;
        IERC20_1(erc20).transfer(sender, totalAmount); // các hợp đồng staking chỉ trả token về user đã tạo

        // Event -----
        emit Withdrawn(sender, stakeId, totalAmount, sd.poolId);

        // update Staking -----
        totalStakeId -= 1;
        delete stakeIdToDetails[stakeId];
    }
    // ================================================================================
    /* ========== end: Write Contract ========== */
    // ================================================================================


    // ================================================================================
    /* ========== internal|private Contract ========== */
    // ================================================================================
    // @
    function _checkPoolIsActive(uint32 poolId) private view returns (bool) {
        if (stakingPoolDeeps[poolId].isPaused) return false;
        if (stakingPools[poolId].startedAt == 0 || block.timestamp < stakingPools[poolId].startedAt) return false;
        return true;
    }
    // ================================================================================
    /* ========== end: internal|private Contract ========== */
    // ================================================================================


    // ================================================================================
    /* ========== Read Contract ========== */
    // ================================================================================
    // StakingPool ------------------------------
    // @
    function totalStakingPool() external view returns (uint256) {
        return stakingPoolIds.length;
    }
    // @
    function poolIdAndActiveByIndexs(uint256[] memory indexs) external view returns (uint32[] memory poolIds, bool[] memory actives) {
        poolIds = new uint32[](indexs.length);
        actives = new bool[](indexs.length);
        for (uint256 i = 0; i < indexs.length; i++) {
            poolIds[i] = stakingPoolIds[indexs[i]];
            actives[i] = _checkPoolIsActive(poolIds[i]);
        }
    }
    // @ ít sử dụng vì đã có poolIdAndActiveByIndexs
    function checkIsActiveByPoolIds(uint32[] memory poolIds) public view returns (bool[] memory results) {
        results = new bool[](poolIds.length);
        for (uint256 i = 0; i < poolIds.length; i++) {
            results[i] = _checkPoolIsActive(poolIds[i]);
        }
    }

    // @
    function rewardCalculation(uint32 poolId, uint128 amount, uint32 duration) public view returns (uint128 reward, uint32 apy) {
        StakingPool memory sPool = stakingPools[poolId];
        // nhân trước chia sau vì chia ra số lẻ sẽ bị làm tròn
        apy = sPool.minAPY + (duration - sPool.minDuration) * (sPool.maxAPY - sPool.minAPY) / (sPool.maxDuration - sPool.minDuration);
        reward = amount * apy * duration * 1 hours / (1 days * 365) / 100000;
    }

    /*
    // @ return Tuple không hoạt động trên connex-v1, chỉ hoạt động trên connex-v2, vượt quá dung lượng, nếu muốn dùng thì dùng hợp đồng ngoại vi
    function stakingPoolByPoolIds(uint32[] memory poolIds) public view returns (StakingPool[] memory pools) {
        pools = new StakingPool[](poolIds.length);
        for (uint256 i = 0; i < poolIds.length; i++) {
            pools[i] = stakingPools[poolIds[i]];
        }
    }
    // @ return Tuple không hoạt động trên connex-v1, chỉ hoạt động trên connex-v2, vượt quá dung lượng, nếu muốn dùng thì dùng hợp đồng ngoại vi
    function stakingPoolDeepByPoolIds(uint32[] memory poolIds) public view returns (StakingPoolDeep[] memory pools) {
        pools = new StakingPoolDeep[](poolIds.length);
        for (uint256 i = 0; i < poolIds.length; i++) {
            pools[i] = stakingPoolDeeps[poolIds[i]];
        }
    } */
    /*
    // @ cái này làm dở cho vechain connex-v1 nhưng bỏ vì vượt quá dung lượng hợp đồng, nếu muốn dùng thì dùng hợp đồng ngoại vi
    function stakingPoolByPoolIds(uint32[] memory poolIds) public view returns (
        address[] memory erc20s,
        uint256[] memory startedAts,
        uint128[] memory commitRewards,
        uint128[] memory minAmounts,
        uint128[] memory maxAmount,
        uint32[] memory minDurations,
        uint32[] memory maxDurations,
        uint32[] memory minAPYs,
        uint32[] memory maxAPYs
    ) {
        erc20s = new address[](poolIds.length);
        startedAts = new uint256[](poolIds.length);
        commitRewards = new uint128[](poolIds.length);
        minAmounts = new uint128[](poolIds.length);
        maxAmount = new uint128[](poolIds.length);
        minDurations = new uint32[](poolIds.length);
        maxDurations = new uint32[](poolIds.length);
        minAPYs = new uint32[](poolIds.length);
        maxAPYs = new uint32[](poolIds.length);
        //
        for (uint256 i = 0; i < poolIds.length; i++) {
            erc20s[i] = stakingPools[poolIds[i]].erc20;
        }
    } */
    // end: StakingPool ------------------------------

    // User ---------------------
    // @
    function totalStakingOf(address account) public view returns (uint256) {
        return _userStakeIds[account].length();
    }
    // @
    function stakeIdsByIndexOf(address account, uint256[] memory indexs) external view returns (uint256[] memory stakeIds) {
        stakeIds = new uint256[](indexs.length);
        for (uint256 i = 0; i < indexs.length; i++) {
            stakeIds[i] = _userStakeIds[account].at(indexs[i]);
        }
    }
    // @
    function stakingsByIndexOf(address account, uint256[] memory indexs) external view returns (
        address[] memory erc20s,
        uint256[] memory startedAts,
        uint128[] memory stakeAmounts,
        uint128[] memory rewardAmounts,
        uint32[] memory durations,
        uint32[] memory poolIds,
        uint256[] memory stakeIds
    ) {
        erc20s = new address[](indexs.length);
        startedAts = new uint256[](indexs.length);
        stakeAmounts = new uint128[](indexs.length);
        rewardAmounts = new uint128[](indexs.length);
        durations = new uint32[](indexs.length);
        poolIds = new uint32[](indexs.length);
        stakeIds = new uint256[](indexs.length);
        //
        for (uint256 i = 0; i < indexs.length; i++) {
            stakeIds[i] = _userStakeIds[account].at(indexs[i]);
            StakingDetails memory sd = stakeIdToDetails[stakeIds[i]];
            //
            erc20s[i] = stakingPools[sd.poolId].erc20;
            startedAts[i] = sd.startedAt;
            stakeAmounts[i] = sd.stakeAmount;
            rewardAmounts[i] = sd.rewardAmount;
            durations[i] = sd.duration;
            poolIds[i] = sd.poolId;
        }
    }
    // end: User ---------------------

    // Staking ---------------------
    // @
    function stakingsByStakeIds(uint256[] memory stakeIds) external view returns (
        address[] memory erc20s,
        uint256[] memory startedAts,
        uint128[] memory stakeAmounts,
        uint128[] memory rewardAmounts,
        uint32[] memory durations,
        uint32[] memory poolIds
    ) {
        erc20s = new address[](stakeIds.length);
        startedAts = new uint256[](stakeIds.length);
        stakeAmounts = new uint128[](stakeIds.length);
        rewardAmounts = new uint128[](stakeIds.length);
        durations = new uint32[](stakeIds.length);
        poolIds = new uint32[](stakeIds.length);
        //
        for (uint256 i = 0; i < stakeIds.length; i++) {
            StakingDetails memory sd = stakeIdToDetails[stakeIds[i]];
            //
            erc20s[i] = stakingPools[sd.poolId].erc20;
            startedAts[i] = sd.startedAt;
            stakeAmounts[i] = sd.stakeAmount;
            rewardAmounts[i] = sd.rewardAmount;
            durations[i] = sd.duration;
            poolIds[i] = sd.poolId;
        }
    }
    // end: Staking ---------------------

    // ERC20 ------------------------------
        // return erc20InfoMap; // không quan trọng, nếu muốn dùng thì dùng hợp đồng ngoại vi
    // end: ERC20 ------------------------------
    // ================================================================================
    /* ========== end: Read Contract ========== */
    // ================================================================================


    // ================================================================================
    /* ========== onlyOwner Write Contract ========== */
    // ================================================================================
    // @
    function setPause(bool pause) external onlyOwner {
        pause ? _pause() : _unpause();
    }

    // @ có thể gọi function này để update nhưng cần thận trọng, không set poolId = 0
    function createStakingPool(uint32 poolId, address erc20, uint256 startedAt, uint128 commitReward,
        uint128 minAmount, uint128 maxAmount, uint32 minDuration, uint32 maxDuration, uint32 minAPY, uint32 maxAPY
    ) external onlyOwner {
        if (stakingPools[poolId].startedAt == 0) {
            // create new
            stakingPoolIds.push(poolId);
        }
        //
        stakingPools[poolId] = StakingPool({
            erc20: erc20,
            startedAt: startedAt > block.timestamp ? startedAt : block.timestamp,
            commitReward: uint128(commitReward),
            minAmount: uint128(minAmount),
            maxAmount: uint128(maxAmount),
            minDuration: uint32(minDuration),
            maxDuration: uint32(maxDuration),
            minAPY: uint32(minAPY),
            maxAPY: uint32(maxAPY)
        });
    }

    // @ chỉ pause chứ không được xóa pool
    function setPoolPause(uint32 poolId, bool pause) external onlyOwner {
        stakingPoolDeeps[poolId].isPaused = pause;
    }

    // @
    function adminUnstake(uint128 stakeId) external onlyOwner {
        StakingDetails memory sd = stakeIdToDetails[stakeId];
        require(sd.account != address(0), "E7"); // E7 = Invalid stakeId

        // update stakingPoolDeeps -----
        StakingPoolDeep storage spDeep = stakingPoolDeeps[sd.poolId];
        spDeep.totalReward -= sd.rewardAmount; // trừ vì user không được nhận reward
        spDeep.remainingStaking -= sd.stakeAmount;
        spDeep.remainingStakeId -= 1;

        // update User -----
        _userStakeIds[sd.account].remove(stakeId);

        // update Erc20Info -----
        address erc20 = stakingPools[sd.poolId].erc20;
        erc20InfoMap[erc20].remainingStaking -= sd.stakeAmount;
        erc20InfoMap[erc20].remainingReward -= sd.rewardAmount;

        // transfer -----
        IERC20_1(erc20).transfer(sd.account, sd.stakeAmount); // chỉ trả stakeAmount, không trả rewardAmount

        // Event -----
        emit ForceWithdrawn(sd.account, stakeId, sd.stakeAmount, sd.poolId);

        // update Staking -----
        totalStakeId -= 1;
        delete stakeIdToDetails[stakeId];
    }

    // @
    function ownerWithdraw(address tokenAddress, address recipient, uint256 amount) external onlyOwner {
        // require(recipient != address(0) && recipient != address(this), "E"); // tiết kiệm gas
        // require(amount > 0, "E"); // tiết kiệm gas
        uint256 total = erc20InfoMap[tokenAddress].remainingStaking + amount;
        if (tokenAddress == address(0)) { // native token
            if (address(this).balance >= total) payable(recipient).transfer(amount);
        } else { // erc20 token
            IERC20_1 erc20Contract = IERC20_1(tokenAddress);
            if (erc20Contract.balanceOf(address(this)) >= total) erc20Contract.transfer(recipient, amount);
        }
    }
    // ================================================================================
    /* ========== end: onlyOwner Write Contract ========== */
    // ================================================================================


    /* ========== EVENTS ========== */
    // không log: reward, duration, erc20, startedAt
    // event Staked(address indexed user, uint256 indexed stakeId, uint128 amount, uint128 reward, uint32 duration, uint32 poolId);
    event Staked(address indexed user, uint256 indexed stakeId, uint128 amount, uint32 duration, uint32 poolId);
    event Withdrawn(address indexed user, uint256 indexed stakeId, uint128 amount, uint32 poolId);
    event ForceWithdrawn(address indexed user, uint256 indexed stakeId, uint128 amount, uint32 poolId);
}
